const mongoose=require('mongoose')

const defaultavatar="data:image/jpeg;base64,"

const Proimg = new mongoose.Schema({
    user: {
      type: String, // Change the type to String if user is supposed to be a string
      required: true
    },
    myfile: {
      type: String,
      default: defaultavatar,
    }
  });
  

const model=mongoose.model("Display_picture",Proimg)
module.exports=model;